#
# TABLE STRUCTURE FOR: comments
#

DROP TABLE IF EXISTS `comments`;

CREATE TABLE `comments` (
  `Id` int(11) DEFAULT NULL,
  `Sender` int(11) DEFAULT NULL,
  `Destination` int(11) DEFAULT NULL,
  `Recording` varchar(256) COLLATE utf8_unicode_ci DEFAULT NULL,
  `Date_Time` datetime DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: community
#

DROP TABLE IF EXISTS `community`;

CREATE TABLE `community` (
  `Id` int(11) DEFAULT NULL,
  `Name` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
  `Number_of_records` int(11) DEFAULT NULL,
  `Number_of_likes` int(11) DEFAULT NULL,
  `Number_0f_subscribers` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: likes
#

DROP TABLE IF EXISTS `likes`;

CREATE TABLE `likes` (
  `Id` int(11) DEFAULT NULL,
  `Sender` int(11) DEFAULT NULL,
  `Destination` int(11) DEFAULT NULL,
  `Date_Time` datetime DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: messages
#

DROP TABLE IF EXISTS `messages`;

CREATE TABLE `messages` (
  `Id` int(11) DEFAULT NULL,
  `Sender` int(11) DEFAULT NULL,
  `Destination` int(11) DEFAULT NULL,
  `Message` varchar(256) COLLATE utf8_unicode_ci DEFAULT NULL,
  `Date_Time` datetime DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `Id` int(11) DEFAULT NULL,
  `Name` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
  `Surname` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
  `Email` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
  `Last_Activity` timestamp NULL DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



